const MyHead = (props) => {
  console.log(title)
  return (
    <Head>
      <title>积木</title>
      <meta name="viewport" content="initial-scale=1.0, width=device-width" />
      <link href="https://cdn.bootcss.com/antd-mobile/2.1.1/antd-mobile.css" rel="stylesheet" />
    </Head>
  )
}

export default MyHead
